import React from 'react';
import '../tab-content/tabcontent.css';

const items = [
        {title: "", content: ""},
        {title: "", content: ""}
    ]

const TabContent = ({title, content}) => {
    
    return (
        <div className='tab-content'>
            <div>{title}</div>
            <div>{content}</div>
        </div>
    );
};

export default TabContent;
